" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Mini-case session #7: Review",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?25/4/25665/contributors\">",
"     Author",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?25/4/25665/contributors\">",
"     Burton D Rose, MD",
"    </a>",
"    <br/>",
"   </div>",
"   <div>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?25/4/25665/contributors\">",
"     Section Editor",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?25/4/25665/contributors\">",
"     Burton D Rose, MD",
"    </a>",
"    <br/>",
"   </div>",
"   <div>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?25/4/25665/contributors\">",
"     Deputy Editor",
"    </a>",
"    <br/>",
"    <a class=\"contributor contributor_credentials\" href=\"UTD.htm?25/4/25665/contributors\">",
"     Theodore W Post, MD",
"    </a>",
"    <br/>",
"   </div>",
"  </div>",
"  <div id=\"disclosures\">",
"   <a href=\"UTD.htm?25/4/25665/contributor-disclosure\" target=\"_blank\">",
"    Disclosures",
"   </a>",
"  </div>",
"  <div id=\"reviewProcess\">",
"   <span>",
"    All topics are updated as new evidence becomes available and our",
"   </span>",
"   <a href=\"/home/editorial-policy\" target=\"_blank\">",
"    peer review process",
"   </a>",
"   <span>",
"    is complete.",
"   </span>",
"  </div>",
"  <div id=\"literatureReviewDate\">",
"   <span class=\"emphasis\">",
"    Literature review current through:",
"   </span>",
"   Oct 2013.",
"   <span class=\"pipeSpace\">",
"    |",
"   </span>",
"   <span class=\"emphasis\">",
"    This topic last updated:",
"   </span>",
"   May 28, 1995.",
"  </div>",
"  <div id=\"topicText\">",
"   <p class=\"headingAnchor\" id=\"H1\">",
"    <span class=\"h1\">",
"     CASE 1",
"    </span>",
"    &nbsp;&mdash;&nbsp;A 57 year-old woman has metastatic ovarian carcinoma, partial small bowel resection, and chronic watery diarrhea (4 to 10 bowel movements per day). She has been feeling less well, resulting in decreased food intake. She now presents with increasing fatigue and weakness.",
"   </p>",
"   <p>",
"    Physical examination reveals an ill-appearing woman with a blood pressure of",
"    <span class=\"nowrap\">",
"     100/60",
"    </span>",
"    supine,",
"    <span class=\"nowrap\">",
"     90/54",
"    </span>",
"    sitting, decreased skin turgor, and lethargy but no focal neurologic signs. Initial laboratory evaluation shows:",
"   </p>",
"   <p>",
"    &nbsp; &nbsp; &nbsp;BUN &nbsp;= &nbsp; 40",
"    <span class=\"nowrap\">",
"     mg/dL",
"     <br/>",
"    </span>",
"    &nbsp; &nbsp; &nbsp;Plasma creatinine &nbsp;= &nbsp;4.3",
"    <span class=\"nowrap\">",
"     mg/dL",
"     <br/>",
"    </span>",
"    &nbsp; &nbsp; &nbsp;Plasma sodium &nbsp;= &nbsp;105",
"    <span class=\"nowrap\">",
"     meq/L",
"     <br/>",
"    </span>",
"    &nbsp; &nbsp; &nbsp;Plasma potassium &nbsp;= &nbsp;1.9",
"    <span class=\"nowrap\">",
"     meq/L",
"     <br/>",
"    </span>",
"    &nbsp; &nbsp; &nbsp;Plasma chloride &nbsp;= &nbsp;90",
"    <span class=\"nowrap\">",
"     meq/L",
"     <br/>",
"    </span>",
"    &nbsp; &nbsp; &nbsp;Plasma bicarbonate &nbsp;= &nbsp;6",
"    <span class=\"nowrap\">",
"     meq/L",
"     <br/>",
"    </span>",
"    &nbsp; &nbsp; &nbsp;Arterial pH &nbsp;= &nbsp;7.24",
"   </p>",
"   <p>",
"    The electrolyte disorders are thought to be secondary to the diarrhea and the renal insufficiency is thought to reflect volume depletion. Renal ultrasonography does not show evidence of obstruction.",
"   </p>",
"   <p>",
"    &nbsp;A. &nbsp;Identify each of the electrolyte abnormalities and how they occurred?",
"   </p>",
"   <p>",
"    &nbsp;B. &nbsp;In general terms, how would you treat each of the electrolyte problems? (See",
"    <a class=\"medical medical_review\" href=\"UTD.htm?18/34/18986?source=see_link\">",
"     \"Overview of the treatment of hyponatremia\"",
"    </a>",
"    and",
"    <a class=\"medical medical_review\" href=\"UTD.htm?9/2/9258?source=see_link\">",
"     \"Clinical manifestations and treatment of hypokalemia\"",
"    </a>",
"    and",
"    <a class=\"medical medical_review\" href=\"UTD.htm?30/44/31432?source=see_link\">",
"     \"Approach to the adult with metabolic acidosis\"",
"    </a>",
"    .).",
"   </p>",
"   <p>",
"    &nbsp;C. &nbsp;What effect will treatment of the metabolic acidosis have on the other electrolyte abnormalities? (See",
"    <a class=\"medical medical_review\" href=\"UTD.htm?25/18/25891?source=see_link\">",
"     \"Potassium balance in acid-base disorders\"",
"    </a>",
"    .).",
"   </p>",
"   <p>",
"    &nbsp;D. &nbsp;What effect will treatment of the hypokalemia have on the other electrolyte disorders? (See",
"    <a class=\"medical medical_review\" href=\"UTD.htm?18/34/18986?source=see_link\">",
"     \"Overview of the treatment of hyponatremia\"",
"    </a>",
"    .)",
"   </p>",
"   <p class=\"headingAnchor\" id=\"H2\">",
"    <span class=\"h1\">",
"     CASE 2",
"    </span>",
"    &nbsp;&mdash;&nbsp;A 65 year-old man with urinary retention due to prostatic disease is catheterized to relieve the urinary obstruction. &nbsp;After draining the urine from the distended bladder, a 24-h urine collection is begun and, at the end, the plasma creatinine concentration is measured.",
"   </p>",
"   <p>",
"    &nbsp; &nbsp; &nbsp;Urine volume &nbsp;= &nbsp;5000 mL",
"    <br/>",
"    &nbsp; &nbsp; &nbsp;Urine creatinine &nbsp;= &nbsp;100",
"    <span class=\"nowrap\">",
"     mg/dL",
"     <br/>",
"    </span>",
"    &nbsp; &nbsp; &nbsp;Plasma creatinine &nbsp;= &nbsp;2",
"    <span class=\"nowrap\">",
"     mg/dL",
"    </span>",
"   </p>",
"   <p>",
"    &nbsp;A. &nbsp;Calculate the creatinine clearance. (See",
"    <a class=\"medical medical_review\" href=\"UTD.htm?34/23/35190?source=see_link\">",
"     \"Calculation of the creatinine clearance\"",
"    </a>",
"    and",
"    <a class=\"medical medical_review\" href=\"UTD.htm?11/49/12050?source=see_link\">",
"     \"Urine output in urinary tract obstruction and postobstructive diuresis\"",
"    </a>",
"    .).",
"   </p>",
"   <p>",
"    Since the results are surprising, a repeat test is performed several days later. The following results are obtained:",
"   </p>",
"   <p>",
"    &nbsp; &nbsp; &nbsp;Urine volume &nbsp;= &nbsp;1440 mL",
"    <br/>",
"    &nbsp; &nbsp; &nbsp;Urine creatinine &nbsp;= &nbsp;100",
"    <span class=\"nowrap\">",
"     mg/dL",
"     <br/>",
"    </span>",
"    &nbsp; &nbsp; &nbsp;Plasma creatinine &nbsp;= &nbsp;1.0",
"    <span class=\"nowrap\">",
"     mg/dL",
"    </span>",
"   </p>",
"   <p>",
"    &nbsp;A. &nbsp;Calculate the creatinine clearance from this collection.",
"   </p>",
"   <p>",
"    &nbsp;B. &nbsp;How do you account for the marked differences in the creatinine clearance and the rate of creatinine excretion in the two collections?",
"   </p>",
"  </div>",
