var title_f25_4_25675="Patients at increased risk for NSAID gastrointestinal toxicity";
var content_f25_4_25675=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F71256&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F71256&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Patients at increased risk for NSAID gastrointestinal toxicity",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        High risk",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        1. History of a previously complicated ulcer, especially recent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2. Multiple (&gt;2) risk factors",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Moderate risk (one to two risk factors)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        1. Age &gt;65 years",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        2. High-dose NSAID therapy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        3. A previous history of uncomplicated ulcer",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        4. Concurrent use of aspirin (including low-dose), glucocorticoids, or anticoagulants",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Low risk",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        1. No risk factors",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Helicobacter pylori is an independent and additive risk factor and needs to be addressed separately (see text and recommendations).",
"    <div class=\"footnotes\">",
"     NSAID: nonsteroidal antiinflammatory drug.",
"    </div>",
"    <div class=\"reference\">",
"     Reprinted by permission from: Macmillan Publishers Ltd: Lanza FL, Chan FKL, Quigley EMM, and the Practice Parameters Committee of the American College of Gastroenterology. Guidelines for prevention of NSAID-related ulcer complications. Am J Gastroenterol 2009; 104:728. Copyright &copy; 2009.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
