var title_f25_4_25676="Antimicrobial prophylaxis for orthopedic surgery";
var content_f25_4_25676=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F87204&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F87204&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Antimicrobial prophylaxis for orthopedic surgery",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <colgroup span=\"3\" width=\"33%\">",
"     </colgroup>",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Common pathogens",
"       </td>",
"       <td class=\"subtitle1\">",
"        Recommended antimicrobials",
"       </td>",
"       <td class=\"subtitle1\">",
"        Usual adult dose*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"2\">",
"        S. aureus, S. epidermidis",
"       </td>",
"       <td>",
"        Cefazolin",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"       <td>",
"        <sup>",
"         <p>",
"          <span style=\"font-family: arial,sans-serif; font-size: 9pt;\">",
"          </span>",
"          &lt;80 kg: 1 g IV",
"         </p>",
"         &ge;80 kg: 2 g IV",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         OR",
"        </strong>",
"        vancomycin",
"        <sup>",
"         &bull;&Delta;",
"        </sup>",
"       </td>",
"       <td>",
"        1 g IV",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Parenteral prophylactic antimicrobials can be given as a single IV dose begun within 60 minutes before the procedure. For prolonged procedures (&gt;3 hours) or those with major blood loss, or in patients with extensive burns, additional intraoperative doses should be given at intervals one to two times the half-life of the drug (ampicillin-sulbactam every 2 hours, cefazolin every 4 hours, cefuroxime every 4 hours, cefoxitin every 2 hours, clindamycin every 6 hours, vancomycin every 12 hours) for the duration of the procedure in patients with normal renal function. If vancomycin or a fluoroquinolone is used, the infusion should be started within 60 to 120 minutes before the initial incision to have adequate tissue levels at the time of incision and to minimize the possibility of an infusion reaction close to the time of induction of anesthesia.",
"     <br>",
"      <font class=\"bullet\">",
"       &bull;",
"      </font>",
"      If a tourniquet is to be used in the procedure, the entire dose of antibiotic must be infused prior to its inflation.",
"      <br>",
"       &Delta; Vancomycin can be used in hospitals in which methicillin-resistant S. aureus and S. epidermidis are a frequent cause of postoperative wound infection, in patients previously colonized with MRSA, or for those who are allergic to penicillins or cephalosporins. Rapid IV administration may cause hypotension, which could be especially dangerous during induction of anesthesia. Even when the drug is given over 60 minutes, hypotension may occur; treatment with diphenhydramine and further slowing of the infusion rate may be helpful. Some experts would give 15 mg/kg of vancomycin to patients weighing more than 75 kg, up to a maximum of 1.5 g, with a slower infusion rate (90 minutes for 1.5 g). For procedures in which enteric gram-negative bacilli are common pathogens, many experts would add another drug such as an aminoglycoside (gentamicin, tobramycin, or amikacin), aztreonam, or a fluoroquinolone.",
"       <br/>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Reprinted with special permission from: Treatment Guidelines from The Medical Letter, October 2012; Vol. 10 (122):73.",
"     <a href=\"file://www.medicalletter.org\" style=\"FONT-STYLE: italic\" target=\"_blank\">",
"      www.medicalletter.org",
"     </a>",
"     .",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
